import React, { PureComponent } from 'react';
import styled from 'styled-components'

class Header extends PureComponent {
  render() {
    return (
      <section>
        <Logo src='/wheels.png' />
        <h1>BIKE SHOP</h1>
        <p>Certified Pre-Owned Bikes</p>
      </section>
    );
  }
}

const Logo = styled.img`
  height: 1em;
`

export default Header;
